Morgan Lee, Ana Foxxx, Katrina Jade, Ashley Adams, James Deen, Erik Everhard, Tommy Gunn, Manuel Ferrara

Ana agrees to babysitter last minute for Manuel, but when she puts the baby to sleep she decides to call her boyfriend for a little bit of fun. Manuel comes home as Ana is playing with herself, and it only gets hotter from there. James comes over to visit Ashley and convince her to do his homework for him. Ashley thinks that's the only reason James is with her, so he shows her just how much he wants her in other physical ways. Katrina is finished babysitting for Erik, but her parents are unavailable to drive her home. Erik suggests she sleep over in the guest bedroom, but Katrina has another way in mind to spend the night. Morgan doesn't take her babysitting job too seriously, instead she uses Tommy's house as an excuse to tan by the pool. When he figures this out and fires her, she knows there is only one way to make sure she gets her job back
